import React, { useState, useEffect } from "react";

export default function PlayerForm() {
    const [formData, setFormData] = useState({
        teamId: "",
        name: "",
        role: "", 
        jerseyNumber: "",
        phone: ""
    });

    const [teams, setTeams] = useState([]);

    // Fetch teams on component mount
    useEffect(() => {
        const fetchTeams = async () => {
            try {
                const response = await fetch("http://localhost:8081/team/fetch"); // adjust URL to your team GET API
                if (!response.ok) throw new Error("Failed to fetch teams");
                const data = await response.json();
                setTeams(data);
            } catch (error) {
                console.error("Error fetching teams", error);
            }
        };
        fetchTeams();
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData((prev) => ({ ...prev, [name]: value }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            const response = await fetch("http://localhost:8082/player/register", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(formData)
            });

            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }

            alert("Player registered successfully!");
            setFormData({
                teamId: "",
                name: "",
                role: "",
                jerseyNumber: "",
                phone: ""
            });
        } catch (error) {
            console.error("Error creating player", error);
            alert("Error creating player");
        }
    };

    const styles = {
        container: {
            maxWidth: "500px",
            margin: "30px auto",
            padding: "20px",
            backgroundColor: "#f9f9f9",
            borderRadius: "8px",
            boxShadow: "0 2px 8px rgba(0, 0, 0, 0.1)"
        },
        title: {
            textAlign: "center",
            color: "#333",
            marginBottom: "20px"
        },
        label: {
            display: "block",
            marginBottom: "6px",
            fontWeight: "bold",
            color: "#444"
        },
        input: {
            width: "100%",
            padding: "10px",
            marginBottom: "15px",
            border: "1px solid #ccc",
            borderRadius: "5px",
            fontSize: "14px"
        },
        select: {
            width: "100%",
            padding: "10px",
            marginBottom: "15px",
            border: "1px solid #ccc",
            borderRadius: "5px",
            fontSize: "14px",
            backgroundColor: "#fff"
        },
        button: {
            width: "100%",
            padding: "12px",
            backgroundColor: "#FF9800",
            color: "#fff",
            border: "none",
            borderRadius: "5px",
            cursor: "pointer",
            fontSize: "16px",
            fontWeight: "bold"
        }
    };

    return (
        <div style={styles.container}>
            <h2 style={styles.title}>Register Player</h2>
            <form onSubmit={handleSubmit}>
                <label style={styles.label}>Team:</label>
                <select
                    name="teamId"
                    value={formData.teamId}
                    onChange={handleChange}
                    style={styles.select}
                    required
                >
                    <option value="">-- Select Team --</option>
                    {teams.map((team) => (
                        <option key={team.id} value={team.id}>
                            {team.id} - {team.teamname}
                        </option>
                    ))}
                </select>

                <label style={styles.label}>Name:</label>
                <input
                    type="text"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                    style={styles.input}
                    required
                />

                <label style={styles.label}>Role:</label>
                <select
                    name="role"
                    value={formData.role}
                    onChange={handleChange}
                    style={styles.select}
                >
                    <option value="">-- Select Role --</option>
                    <option value="BATSMAN">Batsman</option>
                    <option value="BOWLER">Bowler</option>
                    <option value="ALLROUNDER">All-rounder</option>
                    <option value="WICKET_KEEPER">Wicket Keeper</option>
                </select>

                <label style={styles.label}>Jersey Number:</label>
                <input
                    type="number"
                    name="jerseyNumber"
                    value={formData.jerseyNumber}
                    onChange={handleChange}
                    style={styles.input}
                />

                <label style={styles.label}>Phone:</label>
                <input
                    type="text"
                    name="phone"
                    value={formData.phone}
                    onChange={handleChange}
                    style={styles.input}
                />

                <button type="submit" style={styles.button}>
                    Save Player
                </button>
            </form>
        </div>
    );
}
